#include<stdio.h>
#include<stdlib.h>
#include<stdbool.h>



typedef struct node{
	int data;
	struct node *left, *right;
	bool lthread,rthread;
}node;

node* tree=NULL;

int ins(int val){
	node *newnode,*head;
	newnode=malloc(sizeof(node));
	newnode->data=val;
	newnode->lthread=true;
	newnode->rthread=true;
	
	if(tree==NULL){
		head=malloc(sizeof(node));
		head->data=-9999;
		head->left=newnode;
		head->right=head;
		newnode->right=head;
		head->lthread=false;
		head->rthread=false;
		tree=head;
		return 0;
	}
	else{
		
		node *trav=tree->left;
		while(1){
			if(val < trav->data){
				if(trav->lthread == false){
					trav=trav->left;
				}
				else{
					newnode->left=trav->left;
					trav->left=newnode;
					trav->lthread=false;
					newnode->right=trav;
					return 0;
				}
			}
			else if(val >= trav->data){
				if(trav->rthread == false){
					trav=trav->right;
				}
				else{
					newnode->right=trav->right;
					trav->right=newnode;
					trav->rthread=false;
					newnode->left=trav;
					return 0;
				}
			}
		}
		return -1;
	}
}

